> Top News Sainz ruled fit to race in Russia after heavy crash Course marshals remove the crashed car of Toro Rosso driver Carlos Sainz Jr. of Spain during the third free practice at the 'Sochi Autodrom' Formula One circuit in Sochi, Russia, on Saturday, Oct. 10, 2015. A heavy crash for Carlos Sainz Jr. ended the final practice session at the Russian Grand Prix on Saturday with the Toro Rosso driver hospitalized. The Formula one race will be held on Sunday. (AP Photo/Ivan Sekretarev) 
